import React, { Component } from 'react';
import './App.css';
import axios from 'axios';
import { faMinus } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";


class MyBooks extends Component {
  constructor(props){
    super(props);
    this.state={
      books: []
    }
  }

  componentDidMount() {
    axios.get(`http://localhost:8080/books`)
      .then(res => {
        const books = res.data;
        this.setState({ books });
      });
  }

  handleDelete(){
    alert("deleting!");
  }



  render() {
    return (
      <div className="container">
        <div>
          <h1 className="header">My Books</h1>
        </div>
        <table className="table table-sm">
          <thead>
            <tr>
              <th>Title</th>
              <th>Authors</th>
              <th>Category</th>
              <th>Pages</th>
              <th>Read</th>
              <th>Year</th>
              <th></th>
            </tr>
        </thead>
        <tbody>
        {this.state.books.map(book =>
          <tr key={book.id}>
            <td>{book.title}</td>
            <td>{book.authors}</td>
            <td>{book.category}</td>
            <td>{book.numberOfPages}</td>
            <td>{book.readPages}/{book.numberOfPages}</td>
            <td>{book.yearOfPublishing}</td>
            <td><button onClick={this.handleDelete} className="btn btn-outline-secondary"><FontAwesomeIcon icon={faMinus}/></button></td>
          </tr>
        )}
        </tbody>
        </table>


      </div>
    );
  }
}

class App extends Component {
  render() {
    return (
      <html>
        <head>
        <script src="https://code.jquery.com/jquery-3.3.1.slim.min.js" 
                integrity="sha384-q8i/X+965DzO0rT7abK41JStQIAqVgRVzpbzo5smXKp4YfRvH+8abtTE1Pi6jizo" 
                crossorigin="anonymous"></script>

        <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.0/umd/popper.min.js" 
                integrity="sha384-cs/chFZiN24E4KMATLdqdvsezGxaGsi4hLGOzlXwp5UZB1LY//20VyM2taTB4QvJ" 
                crossorigin="anonymous"></script>

        <script src="https://stackpath.bootstrapcdn.com/bootstrap/4.1.0/js/bootstrap.min.js" 
                integrity="sha384-uefMccjFJAIv6A+rW+L4AHf99KvxDjWSu1z9VI8SKNVmz4sk7buKt/6v9KI65qnm" 
                crossorigin="anonymous"></script>

        <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.1.0/css/bootstrap.min.css" 
              integrity="sha384-9gVQ4dYFwwWSjIDZnLEWnxCjeSWFphJiwGPXr1jddIhOegiu1FwO5qRGvFXOdJZ4" 
              crossorigin="anonymous"></link>
        </head>
        <body>
          <div className="App container">
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
              <a class="navbar-brand" href="#pro">Navbar</a>
              <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
              </button>
              <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
                <div class="navbar-nav">
                  <a class="nav-item nav-link active" href="#pro">Home <span class="sr-only">(current)</span></a>
                  <a class="nav-item nav-link" href="#pro">Features</a>
                  <a class="nav-item nav-link" href="#pro">Pricing</a>
                  <a class="nav-item nav-link disabled" href="#pro">Disabled</a>
                </div>
                <form class="form-inline my-2 my-lg-0">
                  <input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search"></input>
                  <button class="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
                </form>
              </div>
            </nav>
            <div className="container"><MyBooks /></div>
          </div>
        </body>
      </html>
    );
  }
}

export default App;
